Vemplate.TEMPLATES.how_to_charge_venmo='<div>\n\tOnce you\'ve installed the iPhone or Android App on your phone, follow these steps to initiate a charge to someone.\n</div>\n<ol class="m_ten_t number_list">\n\t<li>Download the appropriate App for your phone.</li>\n\t<li>Login to the App using your Venmo username and password.</li>\n\t<li>Click "Charge" on the home screen.</li>\n\t<li>In the to field enter "Venmo."  This will autocomplete to Venmo.</li>\n\t<li>Select Venmo as the recipient.</li>\n\t<li>Enter a dollar amount and a note.  In this case you can enter something like, <br/><i class="gray">"$1 for my first Venmo Buck -- woohoo!"</i></li>\n\t<li>Click "Send Charge" and you\'re done!</li>\n\t<li>In the future you can pay or charge anyone in your address book the same way.</li>\n</ol>\n<div class="gray_top_divider m_ten_t"></div>';
Vemplate.TEMPLATES.facebook_user_profile_loggedin='<\!-- DYNAMIC STUFF --\>\n{{#facebook_user}}\n<div class="p_twenty_t p_twenty_b p_twenty_l p_twenty_r">\n    <div class="float_left m_twenty_r">\n            <table class="sq120">\n                <tr>\n                    <td class="blue_box align_center"><img src="{{GIF1}}" onerror="this.src=\'{{GIF1}}\';" longdesc="{{profile_picture}}" /></td>\n                </tr>\n            </table>\n    </div>\n    <div class="float_left relative width350">\n        <div class="medium p_five_t bold">{{name}}</div>\n        <div class="medium gray">{{about}}</div>\n    </div>\n    <div class="clear"></div>\n</div>\n\n{{/facebook_user}}\n<\!-- END DYNAMIC STUFF --\>\n';
Vemplate.TEMPLATES.verification_email_sent='{{#verification_email_details}}\n<div class="p_fifteen_f">\nWe just sent a verification email to <b>{{email_on_file}}</b>\n<br/><br/>\nOnce you have received the email, simply click on the link within it to verify ownership of the email account.\n</div>\n{{/verification_email_details}}';Vemplate.TEMPLATES.email_friends_to_invite_fb='{{#coff_uuid}}\n<div class="__invsug_div_to_count p_five_t hasHoverHiddenChildren" rel=\'{{name}}\' id="invsug_{{cuuid}}" >\n    <input type="submit" class="grayButton float_right" id="invite_{{cuuid}}" \n     onclick="return venmo.friends.inviteByUuidSug(\'{{cuuid}}\'); return false;" value="Invite"/>\n     \n    <img onerror="this.src=\'{{GIF1}}\';" class="sq48 p_five_r float_left" src="{{GIF1}}" longdesc="{{profile_picture}}"/>\n    <div class="bold">{{name}}</div>\n    <div class="small">{{email}}</div>\n    <div class="small hiddenChild" style="display:none;" id="invig_{{cuuid}}"><a href="#" onclick="venmo.account.ignoreSuggestedInviteByUuid(\'{{cuuid}}\');return false;">Ignore</a>&nbsp;</div>\n\n     <div class="clear"></div>\n</div>\n{{/coff_uuid}}\n';
Vemplate.TEMPLATES.right_side_new_to_venmo='{{#story}}\n{{#payment_to_twitter_user}}\n    {{#targ_user}}\n    <div class="m_twenty_t p_ten_f light_yellow_background gray_box med_gray_box_top">\n       <span class="bold"> {{full_name}},</span>\n        <a href="/network/twitter/auth">connect with Twitter</a>\n        to get your money!\n    </div>\n    {{/targ_user}}\n{{/payment_to_twitter_user}}\n<div class="m_twenty_t p_ten_f white_background gray_box med_gray_box_top">\n    <div class="gray m_ten_b bold sidebarTitle">\n        Get Venmo\n    </div>\n    <div class="m_ten_b">\n        Exchanging money with friends should be simple, secure, and enjoyable.\n    </div>\n    <div class="m_ten_b">\n        Venmo builds apps with this goal in mind.\n    </div>\n    <div>\n    {{# ON_IPHONE}}\n    <a href="/ios">Get the free iPhone app</a>\n    {{/ ON_IPHONE}}\n    {{# ON_ANDROID}}\n    <a href="/android">Get the free Android app</a>\n    {{/ ON_ANDROID}}\n    {{^ ON_ANDROID}}\n        {{^ ON_IPHONE}}\n        {{#invite_code}}\n           <a href="{{signup_url}}>Signup Now</a> \n        {{/invite_code}}\n        {{^invite_code}}\n            <a href="https://venmo.com/signup/waiting-list">Join our invite list</a>\n        {{/invite_code}}\n            \n        {{/ ON_IPHONE}}\n    {{/ ON_ANDROID}}\n    </div>\n</div>\n{{/story}}\n';
Vemplate.TEMPLATES.process_reminder_email='<div class="p_fifteen_f">\n    <div>\n        <table width=100%>\n                <tr>\n                    <td class="align_right p_ten_r">\n                        <div class="m_five_t m_five_b">{{name}}\'s email address:</div>                     \n                    </td>\n                    <td class=\'align_left p_ten_l\'>\n                        <div><input id=\'reminder_email_input\' type="text"/></div>\n                    </td>\n                </tr>\n                <tr>\n                    <td class="align_right p_ten_r"></td>\n                    <td>\n                        <div class="p_ten_t p_ten_l p_ten_r float_left">\n                            <button id="reminder_email_input" type="submit" onclick="return venmo.payment.processReminder(\'{{ tuuid }}\', \'{{ email }}\', \'{{ oid }}\', \'reminder_email_input\'); return false">Send email reminder</button><br/>\n                        </div>\n                        <div class="clear"></div>\n                    </td>\n                </tr>\n        </table>\n    </div>\n</div>';
Vemplate.TEMPLATES.whyInstabits='<div class="p_ten_l p_ten_r p_twenty_t">\n    <p class="m_ten_b">\n    At Venmo, we\'ve always wanted payments between friends to be free.\n    </p>\n    <p class="m_ten_b">Until now, the only way we could provide this great user experience was by allowing you to fund payments with credit cards. So, we\'ve been happily covering credit card processing fees for you while working hard to perfect the bank payment experience.\n    </p>\n    <p class="m_ten_b">We\'ve spent months making sure you can keep the amazing Venmo experience and we are excited to offer the best bank payment experience available.\n    </p>\n</div>\n';
Vemplate.TEMPLATES.bank_transfer_status_info='<div class="bold align_top m_ten_t">Complete</div>\n<div class="p_twenty_l p_five_t">\n    <div>\n    \tDone. Money is where it should be -- your bank if you cashed out, \n\tor your Venmo account balance if you added funds.</div>\n</div>\n\n<div class="bold align_top m_ten_t"><em>X</em> days left</div>\n<div class="p_twenty_l p_five_t">\n    <div>\n        Your transfer is currently in progress, and you will see the amount reflected in your Venmo balance after the number of calendar days shown.</div>\n    <div class="p_five_t">\n        Transfers from your bank account to your Venmo account take five business days (Mon-Fri, excluding bank holidays) to complete, although the money will leave your bank account the day after your request. (<a href="https://help.venmo.com/customer/portal/articles/144085">Where\'s my money?</a>)</div>            \n</div>\n\n<div class="bold align_top m_ten_t">Pending</div>\n<div class="p_twenty_l p_five_t">\n    <div>\n        Venmo has received your request to withdraw funds, and will be issuing \n    it shortly.</div>\n    <div class="p_five_t">\n        These are typically issued before the end of the day they were requested \n    on, and <i>this should not affect</i> the amount of time it takes for you \n    to receive the funds.</div>            \n</div>\n\n<div class="bold align_top m_ten_t">Issued</div>\n<div class="p_twenty_l p_five_t">\n    <div>\n        If you cashed out or requested micro deposit verification, then a deposit has been issued to your bank account. These deposits typically take one to two business days (Monday through Friday, excluding bank holidays) to settle into your bank account.\n        </div>\n        <div class="p_five_t">\n        If you made a payment using your bank account, then the payment amount has been deducted from your account. </div>        \n</div>\n\n<div class="bold align_top m_ten_t">Cancelled</div>\n<div class="p_twenty_l p_five_t">\n    <div>\n    \tThis request to add funds to Venmo has been cancelled by Venmo. \n\tNo funds were transfered.</div>\n</div>\n\n<div class="bold align_top m_ten_t">Cancelled and Refunded</div>\n<div class="p_twenty_l p_five_t">\n    <div>\n    \tThis deposit has been cancelled by Venmo and the funds have been \n\treturned to your account.</div>\n</div>\n\n\n<div class="bold align_top m_ten_t">Partial</div>\n<div class="p_twenty_l p_five_t">\n    <div>\n    \tWe attempted to issue this full request, but were only able to \n    \tissue a portion of it. The remainder will be reissued within 24 hours.</div>\n</div>\n\n<div class="bold align_top m_ten_t">Failed</div>\n<div class="p_twenty_l p_five_t">\n    <div>\n    \tThe deposit failed due to a bank or account error, e.g. the routing number \n\twe have on file for you is incorrect. These funds have been refunded to \n\tyour Venmo account and you should have been notified via email.</div>\n</div>\n';
