Vemplate.TEMPLATES.request_ach_debit_permission='{{^no_banks}}\n<div class="p_ten_f p_twenty_t float_left" \n    {{#single_bank}}style="width:320px"{{/single_bank}}>\n    {{#single_bank_payment}}\n        {{#single_bank}}\n        We will fund this payment from your bank account.\n        {{/single_bank}}\n        {{^single_bank}}\n        Please select a bank account to fund this payment:\n        {{/single_bank}}\n    {{/single_bank_payment}}\n    {{^single_bank_payment}}\n        {{#single_bank}}\n        We will fund {{num_bank}} payments of {{amount}} each from your bank account.\n        {{/single_bank}}\n        {{^single_bank}}\n        Please select a bank account to make {{num_bank}} payments of {{amount}} each:\n        {{/single_bank}}\n    {{/single_bank_payment}}\n    {{#single_bank}}\n        {{#banks}}\n            <input id="bank_account" type="hidden" value="{{bank_account_id}}">\n        {{/banks}}\n    {{/single_bank}}\n    {{^single_bank}}\n        <form id="bank_account">\n        {{#banks}}\n            <div class="p_ten_t">\n                <input type="radio" \n                    name="bank_account_choices" \n                    id="{{bank_account_id}}" \n                    value="{{bank_account_id}}"/>\n                <label for="{{bank_account_id}}">\n                    <div class="p_five_l" style="display:inline-block;">\n                        {{#bank_details}}\n                            {{#logo}}\n                                <img style="width:120px;" \n                                src="https://venmo.s3.amazonaws.com{{logo}}"/> \n                            {{/logo}}\n                            {{^logo}}\n                                {{bank_name}} \n                            {{/logo}}\n                        {{/bank_details}}\n                        {{^bank_details}}Bank {{/bank_details}}\n                        ending in ****{{last_four}}\n                    </div>\n                </label>\n            </div>\n        {{/banks}}\n        </form>\n    {{/single_bank}}\n</div>\n{{#single_bank}}\n<div class="p_ten_t p_ten_b p_five_l p_five_r float_left" style="width:150px">\n    {{#banks}}\n    <div>\n        {{#bank_details}}\n            {{#logo}}\n                <img style="width:120px;" src="https://venmo.s3.amazonaws.com{{logo}}"/>\n            {{/logo}}\n            {{^logo}}\n                {{bank_name}}\n            {{/logo}}\n        {{/bank_details}}\n        {{^bank_details}}\n        Bank account\n        {{/bank_details}}\n    </div>\n    <div>\n        ending in ****{{last_four}}\n    </div>\n    {{/banks}}\n</div>\n{{/single_bank}}\n<div class="clear"></div>\n<div class="p_ten_f light_gray">\n    <div>\n        Please note that since we have to first transfer these funds from your bank account to Venmo, this payment may take up to 5 days to complete. We will inform both you and the recipient now, as well as when the payment is completed. As we did with bank deposits, we will continue to speed up all bank transfers.\n    </div>\n</div>\n{{/no_banks}}\n{{#no_banks}}\n<div class="p_ten_f p_twenty_t">\n    To make this payment from your bank account, please add a bank account, or verify a bank account you\'ve already added. Venmo works with:\n</div>\n<div class="p_ten_f">\n    <img src="https://venmo.s3.amazonaws.com/images/banklogos/bank_logos_bar.png"/>\n</div>\n{{/no_banks}}\n';
