Vemplate.TEMPLATES.important_message='<div id="global_important_message">\n    <div class="">\n        <div class="bold m_five_t">1) Share payments with your friends.</div>\n        <div class="m_five_t">\n            Over the past few months, people have been sharing select payments with their friends by publishing them to Facebook and Twitter.  We\'ll be displaying these payments and all future public payments in a receipt feed on your profile and on the homepage.  Payments you make via SMS and through the APPs are still personal by default and you can publish them by adding a "#p" at the end of your note.  \n             <div class="m_five_t">We think that making it easier to publish payments will help you discover new and fun ways to share your most social payments that happen when you\'re out with your friends or at your favorite places.\n             <div class="m_five_t">We will never publish any of your payments unless you explicitly choose to do so, you are always in full control.</div>\n             </div>\n        </div>\n        <div class="bold m_ten_t">2) Trusted relationships must be mutual.</div> \n        <div class="m_five_t">\n            All Trust relationships must be mutual in order to settle up on charges automatically. You may see some pending trusts requests that you need to accept, and since both people must confirm a trusted relationship, you can feel comfortable trusting the friends you spend money with.</div>\n        <div class="bold m_ten_t">3) We\'ve added a powerful search.</div> \n        <div class="m_five_t">Search through payments using the bar at the top and you\'ll notice that we  linkify all hash tags included in a receipt (eg: #dance-party).  This enables powerful and flexible new workflows, like being able to easily group payments (eg, find money you are collecting from friends by searching for "ski trip").\n            <div class="m_five_t">We\'ll also be exposing a search API very soon so you can make your own cool APPS around this data!</div>\n            </div>\n        <div class="m_five_t"></div>\n        <div class=" align_center"><input type="submit" value="Okay!" class="bold large green_button" onclick="venmo.graphics.fadeaway(goog.dom.$(\'global_important_message\')); venmo.message.set_cim_cookie(true); venmo.dialog.hide();"/> </div>\n    </div>                                                                                           \n</div>\n';
