Vemplate.TEMPLATES.what_is_venmo='<div class="p_twenty_f">\n\t<div style="overflow:auto;height:375px;">\n\t\t<div class="large m_ten_b bold">The story.</div>\n\t\t<div class=\'fontSize14 m_ten_b\'>\n\t\t\tVenmo was built by two friends that found it incredibly frustrating to pay each other and their friends back.  I\'ll get you, you get me back hardly ever works out, and eventually the missing cash starts to add up.  Venmo was built to solve this problem by allowing anyone with a phone to settle mini debts between friends in person, securely and instantly.  But that\'s not all.  Venmo is designed to be social and fun, just like the times you have when you\'re spending money with your friends.  You can share your payments, keep track of the places you\'re spending money, and leave personal notes with every payment you make.  We think of Venmo as the best payment service for friends.\n\t\t</div>\n\t\t<div class="large m_ten_b bold">What is Venmo?</div>\n\t\t<div class="fontSize14 m_ten_b">\n\t\t\tVenmo is an iPhone, Android and Blackberry App that lots of people use to pay back their friends.  It\'s completely <b>FREE (no transaction fees)</b> to use, and it makes splitting the bill at a restaurant between a group of friends very easy, and kind of fun.  There are plenty of other ways to use Venmo, for example paying your roommates back for living expenses like rent, utilities and groceries, or getting your co-workers back for lunch runs or coffee runs.  It\'s even useful to send friends birthday cash, or other cash gifts instead of writing checks.  Whenever a friend owes you money, just use Venmo.\n\t\t</div>\n\t\t<div class="large m_ten_b bold">How big is Venmo?</div>\n\t\t<div class="fontSize14 m_ten_b">\n\t\t\tTens of thousands of people in America use Venmo, and we\'ve processed millions of dollars in transaction volume between friends.  And, we\'re still in Private Beta.  That\'s awesome, right?\n\t\t</div>\n\t\t<div class="large m_ten_b bold">What are some ways to use Venmo?</div>\n\t\t<div class="fontSize14 m_ten_b">\n\t\t\tThe most frequent use case is splitting up a lunch or dinner bill at a restaurant with 2 or more friends.  We\'ve all been there before, one person gets the bill and has to figure out how to collect the money from everyone.  Venmo saves the day in this situation.  Other ways people use Venmo are to settle living expenses with roommates like rent, utilities or cable; to get money for concert tickets and trips; to pay co-workers back for coffee or lunch runs.  Basically, whenever someone owes you money, or you owe someone money, just settle it up with Venmo.\n\t\t</div>\n\t\t<div class="large m_ten_b bold">How do I pay someone, where does the money come from?</div>\n\t\t<div class="fontSize14 m_ten_b">\n\t\t\tIt comes from a credit card or a debit card that you link to your phone number.  Once you signup, we walk you through the whole process, and it only takes a couple minutes.\n\t\t</div>\n\t\t\n\t\t<div class="large m_ten_b bold">If I receive money, how does it get into my personal Bank Account?</div>\n\t\t<div class="fontSize14 m_ten_b">\n            Connect your bank account to Venmo, and you\'ll be able to move money from Venmo into your bank account overnight!\n\t\t</div>\n\t\t<div class="large m_ten_b bold">What banks does Venmo work with?</div>\n\t\t<div class="fontSize14 m_ten_b">\n            We\'ve partnered up with all the major banks in the country.\n            <div class="m_ten_t m_ten_b">\n                <img src="https://venmo.s3.amazonaws.com/images/banklogos/bank_logos_bar.png" width="350px;"/>\n            </div>\n\t\t</div>\n\t\t<div class="large m_ten_b bold">Is Venmo Secure?</div>\n\t\t<div class="fontSize14 m_ten_b">\n\t\t\tAbsolutely.  Venmo uses Bank Grade Security and 256-bit SSL to encrypt and transmit all of your data.  Venmo is also certified by Verisign, the leading SSL provider in world. \n\t\t\t<div class="m_ten_t">\n                <a href="https://sealinfo.verisign.com/splash?form_file=fdf/splash.fdf&dn=venmo.com&lang=en"> \n                    <img id="verisign" src="https://d1v6x81qdeozhc.cloudfront.net/static/images/vseal_en_115x82-04f10270d90ee84c0ff8d4b662b18c7a.gif" alt="Venmo is certified by Verisign" /> \n                </a> \n            </div>\n\t\t</div>\n\t\t<div class="large m_ten_b bold">What makes Venmo better than other payment services?</div>\n\t\t<div class="fontSize14">\n\t\t\tFor starters, we\'re completely free to use and there are no transaction fees when you make a payment.\n\t\t    <br /><br />\n\t\t\tThere are lots of other reasons too:\n\t\t\t<br/><br />\n\t\t\t<ul class="bullets_disc">\n\t\t\t\t<li class="m_five_b">\n\t\t\t\t\t<b>Overnight transfers.</b> Venmo offers the fastest bank transfers available anywhere. Request a transfer to your bank account, and the money will be there the next morning.\n\t\t\t\t</li>\n\t\t\t\t<li class="m_five_b">\n\t\t\t\t\t<b>It\'s Social.</b> Venmo is the first social payments service.  On Venmo, you can share select payments with your friends on Venmo, Facebook, Twitter, and Foursquare as a way of telling them what you\'re up to.  This is a fun way to engage with Venmo, and you get to leave comments on shared payments.  Don\'t worry, only friends you explicitly accept can see the payments you share.\n\t\t\t\t</li>\n\t\t\t\t<li class="m_five_b">\n\t\t\t\t\t<b>Realtime Statistics.</b> We give you detailed statistics after every payment you make.  This keeps you informed about how much you\'re spending with your friends, and if you add your location to a payment, we tell you how many times you\'ve visited that place and how much you\'re spending there.\n\t\t\t\t</li>\n\t\t\t\t<li>\n\t\t\t\t\t<b>Your Phone Comes First.</b> You can do everything on your phone.  That includes signing up, adding your credit card and making your first payment.  This makes it so easy to get your friends to use Venmo with you, especially when your hanging out with each other!\n\t\t\t\t</li>\n\t\t\t</ul>\n\t\t</div>\n\t\t<div class="large m_ten_b bold">How much does it cost to use Venmo?</div>\n\t\t<div class="fontSize14 m_ten_b">\n\t\t\tIt\'s completely free to use Venmo.  There are no fees to signup, and there are no transaction fees.\n\t\t</div>\n\t\t<div class="large m_ten_b bold">If it\'s free to use, how does Venmo make money?</div>\n\t\t<div class="fontSize14 m_ten_b">\n\t\t\tWhile Venmo does not work with any service providers, or businesses right now, it has plans to work with them in the future.  There will be standard transaction fees charged to any business that uses Venmo.  This will allow Venmo to remain free for friends to use with each other.\n\t\t</div>\n\t\t<div class="large m_ten_b bold">How do I get an invite to Venmo?</div>\n\t\t<div class="fontSize14 m_ten_b">\n\t\t\tJust join our waiting list, or ask a friend that\'s on there to invite you.  We\'re constantly sending out invitations to new users.\n\t\t</div>\n\t\t<div class="large m_ten_b bold">I have more questions</div>\n\t\t<div class="fontSize14 m_ten_b">\n\t\t\tNot a problem! Just use our contact form to get in touch with us, and we\'ll be happy to answer any of your questions.\n\t\t</div>\n\t</div>\n</div>\n\n';
